import { useRef } from "react";
import "../css/Home.css";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const Home = () => {
  const navigate = useNavigate();

  const navigateToItemsPage = (code) => {
    navigate(`/items?code=${code}`);
  };

  const createNewCode = (code) => {
    axios.post(`${process.env.REACT_APP_API_URL}item?code=${code}`)
  }

  const codeRef = useRef(null);
  return (
    <div className="app">
      <div className="search">
        <input ref={codeRef} id="code" placeholder="code..."></input>
      </div>
      <div>
        <button onClick={() => navigateToItemsPage(codeRef.current.value)}>
          Use Code!
        </button>
        <button>New Code!</button>
      </div>
    </div>
  );
};

export default Home;
